import "./WorkComponent.css";

import { useState } from 'react';
import WorkSkillComponent from "../WorkSkillComponent/WorkSkillComponent";
import AddIcon from '@mui/icons-material/Add';
import RemoveIcon from '@mui/icons-material/Remove';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import LaptopIcon from '@mui/icons-material/Laptop';

function WorkComponent() {
  const [activeIndex, setActiveIndex] = useState(0);

  const pq_skills = ["skill", "skill", "skill"];
  const pq2_skills = ["C#", "Azure SQL", "AWS S3", "AWS EC2", "AWS Lambda", "AWS CloudWatch", "TimescaleDB"];
  const albe_skills = ["skill", "skill", "skill"];

  return (
    <div className="work-container">
      <>
        <Work
          title="Software Development Intern &ensp; | &ensp; PQ Corporation"
          isActive={activeIndex === 0}
          onShow={() => setActiveIndex(activeIndex === 0 ? null : 0)}
          dates="2023&ensp; - &ensp; Present"
        >
          <WorkDescription location="Malvern, PA" website="https://www.pqcorp.com" skills={pq_skills}> This companyd Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum varius
          neque sit amet faucibus sollicitudin.</WorkDescription>
        </Work>
        <Work
          title="Software Development Intern &ensp; | &ensp; PQ Corporation"
          isActive={activeIndex === 1}
          onShow={() => setActiveIndex(activeIndex === 1 ? null : 1)}
          dates="2022&ensp; - &ensp; 2022"
        >
          <WorkDescription location="Malvern, PA" website="https://www.pqcorp.com" skills={pq2_skills}> This companyd Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum varius
          neque sit amet faucibus sollicitudin.</WorkDescription>
        </Work>
        <Work
          title="Albe"
          isActive={activeIndex === 2}
          onShow={() => setActiveIndex(activeIndex === 2 ? null : 2)}
          dates="2019&ensp; - &ensp; Present"
        >
          <WorkDescription location="Remote" website="https://www.myalbe.com" skills={albe_skills}> This companyd Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum varius
          neque sit amet faucibus sollicitudin.</WorkDescription>
        </Work>
      </>
    </div>
  );
}

function Work({
  title,
  children,
  isActive,
  onShow,
  skills,
  dates
}) {
  return (
    <div className="work">
      <div className="work-header">
        <h6 id="work-title">{title}</h6>
        <div id="sm-container">
          <h6 id="work-dates">{dates}</h6>
          <button id="open-button" onClick={onShow}>{isActive ? <RemoveIcon/> : <AddIcon/>}</button>
        </div>
      </div>
      {isActive && <p>{children}</p>}
    </div>
  );
}

function webNameOnly(website) {
  let str = String(website);
  let arr = str.split(".");
  let string = arr[1].concat(".", arr[2]);
  return string;
}

function WorkDescription({
  location,
  website,
  children,
  skills
}) {

  return (
    <div className="work-desc-container">
      <div className="work-desc-header">
        <p id="location"><LocationOnIcon style={{marginRight:10}}/>{location}</p>
        <a id="website" href={website}><LaptopIcon style={{marginRight:10}}/>{webNameOnly(website)}</a>
      </div>
      <div className="work-desc-vert">
        {children}
      </div>
      <div id="work-skills-container">
            {skills.map(skill => (
              <WorkSkillComponent name={skill}/>
            ))}
        </div>
    </div>
  );
}

export default WorkComponent;
